function App() {
  let like = 0;
  return (
    <div className="App">
      <h1>{like}</h1>
      <button onClick={() => like += 1}>Upgrade</button>
      <button onClick={() => like -= 1}>Downgrade</button>

    </div>
  );
};

export default App;
